import React, {useState, useEffect} from "react";
import './App.css';
import Header from "./Header.js";
import Tickers from "./Tickers.js";
import Charts from "./Charts.js";
import {show} from "./Tickers.js";

function App() {

    let [j, setJ] = useState();

    useEffect(() => {
        fetch("http://localhost:9000/stockAPI/")
            .then(response => response.json())
            .then(data => setJ(show));
        setJ(show);
        console.log(j);
    } );

  return (
    <div className="App">
      <div className="app_header">
        <Header />
      </div>
      <div className="app_body">
        <div className="app_container">
            <Tickers />
            <text style={{color: "white", fontSize: 100}}>{j[0]}</text>
            {/*<Charts name={j}/>*/}
        </div>
      </div>
        <div className="app_ending" style={{paddingTop: 500, paddingBottom: 20}}>
            <text style={{color: "white", display: "flex", justifyContent: "center"}}>Made by Anuj Vasil for Gatsby Labs </text>
        </div>
    </div>
  );
}

export default App;
